import { fetchProjects } from '../../../utils/api'
import { 
  FETCH_PROJECTS_FOR_GALLERY,
} from '../../../utils/constants'

export const getProjects = () => dispatch => {
  return fetchProjects().then(projects => {
    dispatch({
      type: FETCH_PROJECTS_FOR_GALLERY,
      payload: projects,
    })
  })
}
